<text id="Supporting text" fill="#696969" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="16" letter-spacing="0em"><tspan x="50" y="387.818">Invictus Lords tracks your progress using </tspan><tspan x="50" y="409.818">game provider APIs; No software required, </tspan><tspan x="50" y="431.818">no extra steps. Relax, play and come back to </tspan><tspan x="50" y="453.818">check your progress.&#10;</tspan></text>
<text id="Supporting text_2" fill="#696969" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="16" letter-spacing="0em"><tspan x="50" y="534.818">Obtain your place in leaderboard by </tspan><tspan x="50" y="556.818">competing, higher ranking means more </tspan><tspan x="50" y="578.818">rewards.</tspan></text>
<g id="Supporting text_3">
<text fill="#696969" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="16" letter-spacing="0em"><tspan x="150.109" y="692.818"> rewards are distributed daily </tspan><tspan x="50" y="714.818">on all leaderboard players. And are splitted </tspan><tspan x="50" y="736.818">between different games.</tspan></text>
<text fill="#696969" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="16" letter-spacing="0em"><tspan x="243.891" y="736.818"> Players can </tspan><tspan x="50" y="758.818">redeem their rewards on the Ethereum </tspan><tspan x="50" y="780.818">network via Metamask.</tspan></text>
<text fill="#696969" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="16" letter-spacing="0em"><tspan x="50" y="692.818">100,000 VON</tspan></text>
</g>
